import React, { Component } from 'react';

class WorkOrders extends Component{
    constructor(props){
        super(props);
        this.state = {
            workorders : []
        }
    }

    componentDidMount(){
        this.getWorkorders();
    }

    getWorkorders(){
        fetch('http://localhost:4006/Workorders')
        .then(res => res.json())
        .then(workorders => this.setState({workorders}))
    }

    render(){
        const {workorders} = this.state
        return(
            <div>
                <table>
                    <table>
                        <tr>
                            <th>Project Id</th>
                            <th>Workorder Number</th>
                            <th>Workorder Description</th>
                            <th>Status</th>
                            <th>Report Date</th>
                            <th>Workorder Location</th>
                            <th>Workorder type</th>
                            <th>TPID</th>
                            <th>PSPProject</th>
                            <th>PS Project Description</th>
                            <th>PS Activity</th>
                            <th>PS Action Desctiption</th>
                        </tr>
                    </table>
                    <table>
                        {workorders.length ? (
                            <div>
                                {workorders.map ((item)=>{
                                    return(
                                        <tr>
                                    <td>{item.w_projectid}</td>
                                    <td>{}</td>
                                        </tr>
                                    )
                                })}
                            </div>
                        ): (
                            <div>
                                Loading
                            </div>
                        )}
                    </table>
                </table>




                {workorders.length ? (
                    <div>
                        {workorders.map ((item)=>{
                            return(
                            <p>{item.w_status}</p>
                            )
                        })}
                    </div>
                ):(<div>
                    Loading ....
                    </div>) }
            </div>
        )
    }
}

export default WorkOrders;
